column8:
デルタダイレクトの世界初のポン付けバック専用HIDライティングユニットの問題点をふまえ、さらなる進化を遂げたバックHIDバージョン2。<Br>
わずかな電流値でも安定作動する15W省電力バラストによって、純正バック配線へ接続するだけのカプラーオンを実現。<Br>
※類似品にご注意下さい。<Br>
※取り付けの際、ランプのハウジングやボディーへ多少の加工が必要な場合があります。<Br>
※2灯入りです。<Br><style type="text/css">
